import React from 'react'
import axios from 'axios'


function Home() {
  React.useEffect(() => {
    getProducts()
  }, [])

  function getProducts() {
    const url = 'http://localhost:3000/api/products'
    axios.get(url)
    .then(response => console.log(response.data));

  }


  return <>home</>;
}

export default Home;
